INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (1, "ミヤコ（クリスマス）", "みやこ", 1, 3, 119901, 119901, 0, 0, 0, "2023/12/27 11:59:59", 14, 302, 0, 0, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 1, 1, 450, 2.17, 0, 119901, "2023/12/22 12:00:00", 119901);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (5, "シズル（ノワール）", "しずる", 1, 3, 120001, 120001, 0, 0, 0, "2024/03/28 11:59:59", 6, 190, 0, 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 1, 5, 450, 2.375, 0, 120001, "2024/03/22 12:00:00", 120001);
INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (7, "イオ（ノワール）", "いお", 0, 3, 120101, 120101, 0, 0, 0, "2030/12/31 15:00:00", 0, 0, 0, 0, "", 0, 7, 0, 0.0, 0, 0, "2015/04/01 15:00:00", 0);
