INSERT INTO `v1_abc1dfc7b70403290cade301570a7d189193b19b495acedbb7ecc9e68899c660` VALUES (6, "カズマサ", "かずまさ", 1, 1, 191301, 191301, 0, 0, 0, "2030/12/31 15:00:00", 0, 850, 0, 0, "【物理】皆から愛される漁師町のポンコツ漁師。\nユニオンバーストは強力なスタン効果を持つが、\n自身のＨＰが50%以下では尻もちをついてしまう。\n\n・通常攻撃とユニオンバーストを駆使して戦う。", 1, 6, 450, 2.22, 0, 191301, "2015/04/01 15:00:00", 191301);
